import React from 'react'
import { BrowserRouter } from 'react-router-dom'
import 'materialize-css'
import {useRoutes} from './routes'


function App() {
  // params isAuthorized: Bool
  const {} = useAuth()
  const routes = useRoutes( false )
  return (
    <BrowserRouter>
      <div className="container">
        { routes }
      </div>
    </BrowserRouter>
  )
}

export default App
